}

.image-item {
    flex: 0 0 calc(33.333% - 0.666rem); /* subtract a portion of the gap */
    max-width: calc(33.333% - 0.666rem);
}

.image-item img {
    width: 100%;
    height: auto;
    display: block;
    border-radius: 5px;
}

/* Optional: for very small screens, still 3 per row */
@media (max-width: 576px) {
    .image-item {
        flex: 0 0 calc(33.333% - 0.666rem);
        max-width: calc(33.333% - 0.666rem);
    }
}


